8349	nm0000640	Martin Sheen	2	1940-08-03 00:00:00	\N	Ramón Antonio Gerardo Estévez (born August 3, 1940), known professionally as Martin Sheen, is an American actor. He first became known for his roles in the films The Subject Was Roses (1968) and Badlands (1973), and later achieved wide recognition for his leading role as Captain Benjamin Willard in Apocalypse Now (1979), as U.S. President Josiah Bartlet in the television series The West Wing (1999–2006), and as Robert Hanson in the Netflix television series Grace and Frankie (2015–2022).\n\nIn film, Sheen has won the Best Actor award at the San Sebastián International Film Festival for his performance as Kit Carruthers in Badlands. Sheen's portrayal of Capt. Willard in Apocalypse Now earned a nomination for the BAFTA Award for Best Actor.\n\nSheen has worked with a wide variety of film directors, including Richard Attenborough, Francis Ford Coppola, Terrence Malick, David Cronenberg, Mike Nichols, Martin Scorsese, Steven Spielberg, and Oliver Stone. Sheen received a star on the Hollywood Walk of Fame in 1989. In television, Sheen has won a Golden Globe and two Screen Actors Guild awards for playing the role of President Josiah Bartlet in The West Wing, and an Emmy for guest starring in the sitcom Murphy Brown. In 2012, he portrayed Uncle Ben in The Amazing Spider-Man directed by Marc Webb.\n\nBorn and raised in the United States by a Spanish father and an Irish mother, he adopted the stage name Martin Sheen to help him gain acting parts. He is the father of four children, all of whom are actors.\n\nSheen has directed one film, Cadence (1990), in which he appears alongside his sons Charlie and Ramón. He has narrated, produced, and directed documentary television, earning two Daytime Emmy awards in the 1980s, and has been active in liberal politics.\n\nDescription above from the Wikipedia article Martin Sheen, licensed under CC-BY-SA, full list of contributors can be found on Wikipedia.	USA	/m2Y3Q0uyuW6htrn2W9UWCWMkpZu.jpg
1498158	nm2976580	Jessie Buckley	1	1989-12-28 00:00:00	\N	Jessie Buckley (born 28 December 1989) is an Irish actress and singer. A Royal Academy of Dramatic Art graduate, she began her career in 2008 as a contestant on the BBC TV talent show I'd Do Anything, in which she came second. The recipient of a Laurence Olivier Award, in addition to nominations for an Academy Award and three BAFTA Awards, she was listed at number 38 on The Irish Times' list of Ireland's greatest film actors of all time, in 2020.\n\nHer early onscreen appearances include portrayals in BBC television series, such as Marya Bolkonskaya in the 2016 adaptation of Leo Tolstoy's War and Peace, Lorna Bow in Taboo (2017) and Marian Halcombe in The Woman in White (2018).\n\nBuckley made her film debut playing the lead role of Moll Huntford in Beast (2017). Her other roles include Rose-Lynn Harlan in Wild Rose (2018), for which she received a nomination for the BAFTA Award for Best Actress in a Leading Role, Lyudmilla Ignatenko in the HBO miniseries Chernobyl (2019), the Young Woman in I'm Thinking of Ending Things (2020), Oraetta Mayflower in season four of Fargo (2020) and young Leda in The Lost Daughter (2021). Her performance in the latter earned her a nomination for the Academy Award for Best Supporting Actress. In 2019, she was recognised by Forbes in its annual 30 Under 30 list. Buckley starred as Sally Bowles in a West End revival of Cabaret in 2021, for which she won the Laurence Olivier Award for Best Actress in a Musical.	IRL	/jKhDQOMVQ1JP4gaUXCQg75gvsrm.jpg
