64	nm0000198	Gary Oldman	2	1958-03-21 00:00:00	\N	Gary Leonard Oldman (born 21 March 1958) is an English actor and filmmaker. Regarded as one of the best actors of his generation, he is known for his versatility and intense acting style. He received various accolades, including an Academy Award, a Golden Globe Award, a Screen Actors Guild Award, and three British Academy Film Awards. His films have grossed over $11 billion worldwide, making him one of the highest-grossing actors to date.\n\nOldman began acting in theatre in 1979 and made his film debut in Remembrance (1982). He continued to follow a stage career in London's Royal Court and was a member of the Royal Shakespeare Company, with credits including Cabaret, Romeo and Juliet, Entertaining Mr Sloane, Saved, The Country Wife and Hamlet. He rose to prominence in British film with his portrayals of Sid Vicious in Sid and Nancy (1986), Joe Orton in Prick Up Your Ears (1987) and Rosencrantz in Rosencrantz & Guildenstern Are Dead (1990), while also attracting attention as the leader of a gang of football hooligans in the television film The Firm (1989). Regarded as a member of the "Brit Pack", he achieved greater recognition as a New York gangster in State of Grace (1990), Lee Harvey Oswald in JFK (1991) and Count Dracula in Bram Stoker's Dracula (1992).\n\nOldman portrayed the villains in films such as True Romance (1993), The Fifth Element (1997), Air Force One (1997) and The Contender (2000); corrupt DEA agent Norman Stansfield, whom he played in Léon: The Professional (1994), was called one of cinema's best villains. He also played Ludwig van Beethoven in Immortal Beloved (1994) and later appeared in franchise roles such as Sirius Black in the Harry Potter series, James Gordon in The Dark Knight Trilogy (2005–2012) and a human leader, Dreyfus in Dawn of the Planet of the Apes (2014). He won the Academy Award for Best Actor for his role as Winston Churchill in Darkest Hour (2017), and was nominated for his portrayals of George Smiley in Tinker Tailor Soldier Spy (2011) and Herman J. Mankiewicz in Mank (2020).\n\nOldman was executive producer of films like The Contender, Plunkett & Macleane (1999) and Nil by Mouth (1997), the latter of which he also wrote and directed. He featured in television shows such as Fallen Angels, Tracey Takes On... and Friends, voiced Ignitius and Viktor Reznov respectively in The Legend of Spyro and Call of Duty video games and appeared in music videos for David Bowie, Guns N' Roses and Annie Lennox.	GBR	/2v9FVVBUrrkW2m3QOcYkuhq9A6o.jpg
71070	nm1086543	Amanda Seyfried	1	1985-12-03 00:00:00	\N	Amanda Michelle Seyfried (born December 3, 1985) is an American actress, singer and model. She is the recipient of various accolades, including two Satellite Awards, a ShoWest Award, and nominations for an Academy Award, a Screen Actors Guild Award, a Critics' Choice Movie Award and a Saturn Award.\n\nBorn and raised in Allentown, Pennsylvania, she began modeling at age eleven and ventured into acting at age 15 with recurring roles as Lucy Montgomery on the CBS soap opera As the World Turns (1999–2001) and Joni Stafford on the ABC soap opera All My Children (2003). Seyfried came to prominence following her feature film debut in the teen comedy Mean Girls (2004) and her recurring role as Lilly Kane on the UPN television series Veronica Mars (2004–2006) and Sarah Henrickson on the HBO drama series Big Love (2006–2011).\n\nSeyfried has appeared in a number of successful films, including Mamma Mia! (2008) and its sequel Mamma Mia! Here We Go Again (2018), Jennifer's Body (2009), Chloe (2009), Dear John (2010), Letters to Juliet (2010), Red Riding Hood (2011), In Time (2011), Gone (2012), Lovelace (2013), A Million Ways to Die in the West (2014), Ted 2 (2015), and First Reformed (2017). She has also occasionally done voice-over work in animation films, such as Epic (2013) and Scoob! (2020). In 2022, she portrayed Elizabeth Holmes in the Hulu limited series The Dropout.\n\nFor her portrayal of Cosette in Tom Hooper's musical film Les Misérables (2012), Seyfried was nominated for the Screen Actors Guild Award for Outstanding Performance by a Cast in a Motion Picture. She received critical acclaim for playing Marion Davies in David Fincher's Mank (2020), which earned her nominations for the Academy Award, Golden Globe Award, and Critics' Choice Movie Award for Best Supporting Actress.\n\nDescription above from the Wikipedia article Amanda Seyfried, licensed under CC-BY-SA, full list of contributors on Wikipedia.	USA	/gtBUIpZ3dvLpOMIVORxE6sHSyZj.jpg
112561	nm2934314	Lily Collins	1	1989-03-18 00:00:00	\N	Lily Jane Collins (born 18 March 1989) is a British and American actress and model. Born in Guildford, Surrey and raised in Los Angeles, Collins began performing on screen at the age of two in the BBC sitcom Growing Pains. In the late 2000s, Collins began acting and modelling more regularly, and she had a career breakthrough with her performance in the sports-drama film The Blind Side, which was the third highest-grossing film of 2009. She went on to appear in leading roles across feature films such as the sci-fi action-horror Priest (2011), the psychological action-thriller Abduction (2011), the fantasy Mirror Mirror (2012), the urban fantasy The Mortal Instruments: City of Bones (2013), and the independent romantic comedies Stuck in Love (2012), The English Teacher (2013), and Love, Rosie (2014).\n\nCollins was critically acclaimed for her roles as Marla Mabrey in the comedy Rules Don't Apply (2016), which earned her a nomination for the Golden Globe Award for Best Actress – Motion Picture Musical or Comedy, and for her portrayal of a young adult with anorexia in the controversial Netflix drama To the Bone (2017). She has also achieved recognition for her work in biographical films: she starred as Liz Kendall in the Netflix drama Extremely Wicked, Shockingly Evil and Vile (2019), as J.R.R. Tolkien's wife Edith in Tolkien (2019), and as Rita Alexander in Mank (2020), the latter of which was a critical success, earning 10 Academy Award nominations.\n\nCollins played Fantine in the BBC miniseries adaptation of Les Misérables (2018–2019), and, since 2020, she has portrayed Emily Cooper in the Netflix series Emily in Paris. For the latter, she received a nomination for the Golden Globe Award for Best Actress – Television Series Musical or Comedy. She made her writing debut with Unfiltered: No Shame, No Regrets, Just Me (2017) in which she discussed her struggles with mental health, including an eating disorder she suffered as a teenager.	GBR	/aFSZkMNjmDR07JtkvhcbLAbDAMx.jpg
