36662	nm1659547	Carey Mulligan	1	1985-05-28 00:00:00	\N	Carey Hannah Mulligan (born 28 May 1985) is an English actress. She has received numerous accolades, including a British Academy Film Award and a Critics' Choice Movie Award, in addition to nominations for two Academy Awards, two Golden Globe Awards, four Screen Actors Guild Awards, and a Tony Award.\n\nMulligan made her professional acting debut on stage in the 2004 Kevin Elyot play Forty Winks at the Royal Court Theatre. Her film debut came with a supporting role in the romantic drama Pride & Prejudice (2005), followed by roles in television, including the drama series Bleak House (2005) and the television film Northanger Abbey (2007). She also played Sally Sparrow in the Doctor Who episode "Blink". Mulligan made her Broadway debut in the 2008 revival of the Anton Chekhov play The Seagull, which earned her an Ian Charleson Commendation Award.\n\nMulligan's breakthrough role came as a 1960s schoolgirl in the coming-of-age drama film An Education (2009), for which she won the BAFTA Award for Best Actress in a Leading Role, and gained her first nomination for the Academy Award for Best Actress. She continued as an established actor, with roles in the dystopian romance Never Let Me Go (2010), action drama Drive (2011), which earned her a nomination for the BAFTA Award for Best Actress in a Supporting Role, erotic drama Shame (2011), romantic drama The Great Gatsby (2013), and the black comedy-drama Inside Llewyn Davis (2013). In 2015, Mulligan was nominated for a Tony Award for Best Actress in a Play for her performance in the Broadway revival of David Hare's Skylight. In 2018, she starred in the Netflix limited series Collateral and Paul Dano's acclaimed drama film Wildlife. For her portrayal of a vigilante in the thriller Promising Young Woman (2020), Mulligan received widespread praise and a second Academy Award nomination for Best Actress.​	\N	/3B1PDEBAZKyNLUbXggU7C215BCs.jpg
115128	nm3102998	Bo Burnham	2	1990-08-21 00:00:00	\N	Robert Pickering "Bo" Burnham (born August 21, 1990) is an American comedian, musician, actor, film director, screenwriter, and poet. He began his career on YouTube in March 2006, with his videos gaining more than 300 million views as of March 2021.\n\nBurnham signed a four-year record deal with Comedy Central Records and released his debut EP, Bo fo Sho, in 2008. His first full-length album, Bo Burnham, was released the following year. At the age of 18, he became the youngest person to record a half-hour comedy special with Comedy Central. In 2010, his second album, Words Words Words, was released along with his first live comedy special of the same name on Comedy Central. His third album and second comedy special, what., was released in 2013 on his YouTube channel and Netflix. He finished in first place at the 2011 Comedy Central Stand-up Showdown. His third stand-up comedy special, Make Happy, was released exclusively on Netflix in 2016. His fourth comedy special, Bo Burnham: Inside, premiered on Netflix in 2021.\n\nIn 2013, Burnham co-created and starred in the MTV television series Zach Stone Is Gonna Be Famous and released a book of poetry called Egghead: Or, You Can't Survive on Ideas Alone. His first feature film as a writer and director, Eighth Grade, was released in 2018 to widespread critical acclaim; among other accolades, it received the Writers Guild of America Award for Best Original Screenplay and the Directors Guild of America Award for Outstanding Directing – First-Time Feature Film. In 2020, Burnham starred as Ryan Cooper in the film Promising Young Woman.	USA	/xMAatohXadCfz9ipvqvIaTLwOmV.jpg
