4173	nm0000164	Anthony Hopkins	2	1937-12-31 00:00:00	\N	Sir Philip Anthony Hopkins CBE (born 31 December 1937) is a Welsh actor, film director, and film producer. He is the recipient of numerous accolades, including two Academy Awards, four British Academy Film Awards, two Primetime Emmy Awards and a British Academy Television Award. He has also received an honorary Golden Globe Award and the BAFTA Fellowship from the British Academy of Film and Television Arts. In 1993, he was knighted by Queen Elizabeth II for his services to the arts, and in 2003, he received a star on the Hollywood Walk of Fame for his achievements in the motion picture industry.\n\nAfter graduating from the Royal Welsh College of Music & Drama in 1957, Hopkins trained at the Royal Academy of Dramatic Art in London, and was then spotted by Laurence Olivier who invited him to join the Royal National Theatre in 1965. Productions at the National included King Lear, his favourite Shakespeare play. His last stage play was a West End production of M. Butterfly in 1989.\n\nIn 1968, Hopkins achieved recognition in film, playing Richard the Lionheart in The Lion in Winter. In the mid-1970s, Richard Attenborough, who directed five Hopkins films, called him "the greatest actor of his generation." In 1991, he portrayed Hannibal Lecter in the psychological horror film The Silence of the Lambs, winning the Academy Award for Best Actor. He reprised the role in its sequel Hannibal and the prequel Red Dragon. Other notable films include The Elephant Man (1980), 84 Charing Cross Road (1987), Howards End (1992), Bram Stoker's Dracula (1992), Shadowlands (1993), Legends of the Fall (1994), Meet Joe Black (1998), The Mask of Zorro (1998), Thor (2011), Thor: The Dark World (2013), Transformers: The Last Knight (2017), and Thor: Ragnarok (2017). He received four more Academy Award nominations for The Remains of the Day (1993), Nixon (1995), Amistad (1997) and The Two Popes (2019) before winning a fourth BAFTA Award and a second Academy Award for Best Actor for his portrayal of an elderly man diagnosed with dementia in The Father (2020), becoming the oldest Best Actor Oscar winner to date.\n\nSince making his television debut with the BBC in 1967, Hopkins has continued to appear on television. In 1973 he received a British Academy Television Award for Best Actor for his performance in War and Peace. In 2015, he starred in the BBC film The Dresser alongside Ian McKellen. In 2018, he starred in King Lear opposite Emma Thompson. In 2016 and 2018, he starred in the HBO television series Westworld, for which he received a Primetime Emmy Award nomination.\n\nDescription above from the Wikipedia article Anthony Hopkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.	GBR	/9ukJS2QWTJ22HcwR1ktMmoJ6RSL.jpg
39187	nm1469236	Olivia Colman	1	1974-01-30 00:00:00	\N	Sarah Caroline Sinclair CBE (January 30, 1974), known professionally as Olivia Colman, is an English actress. Known for her comedic and dramatic roles in film and television, she has received various accolades, including an Academy Award, a British Academy Film Award, two Emmy Awards, three British Academy Television Awards and three Golden Globe Awards.\n\nShe was acclaimed for her performance in the ITV crime-drama series Broadchurch (2013–2017), for which she received a British Academy Television Award for Best Actress. She played Queen Elizabeth II from 2019 to 2020 in the Netflix period-drama series The Crown, for which she received a Golden Globe Award and a Primetime Emmy Award for Outstanding Lead Actress in a Drama Series.\n\nFor her portrayal of Anne, Queen of Great Britain in the period black-comedy film The Favourite (2018), Colman received the Academy Award for Best Actress. She received additional Academy Award nominations for her performances in The Father (2020) and The Lost Daughter (2021). Other notable film credits include Hot Fuzz (2007), Tyrannosaur (2011), The Iron Lady (2011), Hyde Park on Hudson (2012), Locke (2013), The Lobster (2015), Murder on the Orient Express (2017), The Mitchells vs. the Machines (2021) and Empire of Light (2022).	GBR	/4ZwZ66zXZyX26Kf2wfeMt1tQZQf.jpg
