37632	nm1519666	Eddie Redmayne	2	1982-01-06 00:00:00	\N	Edward John David Redmayne OBE (born 6 January 1982) is an English actor and model. He is the recipient of various accolades, including an Academy Award, a Tony Award, a Golden Globe Award, a Screen Actors Guild Award, and a British Academy Film Award.\n\nHe began his professional acting career in West End theatre before making his screen debut in 1996 with guest television appearances. His first films were Like Minds (2006), The Good Shepherd (2006) and Elizabeth: The Golden Age (2007). On the stage, Redmayne starred in the productions of Red from 2009 to 2010 and Richard II from 2011 to 2012. The former won him the Tony Award for Best Featured Actor in a Play.\n\nRedmayne's film breakthrough came with the roles of Colin Clark in the biographical drama My Week with Marilyn (2011) and Marius Pontmercy in Tom Hooper's musical Les Misérables (2012). He garnered consecutive nominations for the Academy Award for Best Actor for his portrayals of physicist Stephen Hawking in The Theory of Everything (2014), and transgender artist Lili Elbe in The Danish Girl (2015), winning for the former. In 2016, he began starring as Newt Scamander in the Fantastic Beasts film series.	GBR	/fSvG7qzoBBnJUmgtIuMgrK3EQPN.jpg
6730	nm0056187	Sacha Baron Cohen	2	1971-10-13 00:00:00	\N	Sacha Noam Baron Cohen (born 13 October 1971) is an English actor, comedian, writer, and producer. He is best known for his creation and portrayal of the fictional satirical characters Ali G, Borat Sagdiyev, Brüno Gehard, and Admiral General Aladeen. He adopts a variety of accents and guises for his characters and interacts with unsuspecting subjects who do not realise they have been set up. At the 2012 British Comedy Awards, he received the Outstanding Achievement Award and accepted the award in-character as Ali G. In 2013, he received the BAFTA Charlie Chaplin Britannia Award for Excellence in Comedy. In 2018, The Times named him among the 30 best living comedians.\n\nBaron Cohen has produced and/or performed in comedic films such as Ali G Indahouse (2002), Borat (2006) and its sequel Borat Subsequent Moviefilm (2020), Talladega Nights: The Ballad of Ricky Bobby (2006), Brüno (2009), and The Dictator (2012). He has also appeared in dramatic films including Tim Burton's Sweeney Todd: The Demon Barber of Fleet Street (2007), Martin Scorsese's Hugo (2011), Tom Hooper's Les Misérables (2012), and Aaron Sorkin's The Trial of the Chicago 7 (2020). He made a cameo as a BBC News anchor in Anchorman 2: The Legend Continues (2013). In 2016, he appeared in the comedy film Grimsby and co-starred in the fantasy sequel Alice Through the Looking Glass. His voice acting roles include King Julien XIII in the Madagascar film series (2005–2012) and Uncle Ugo in Luca (2021).\n\nBeginning his career in television, Baron Cohen was named Best Newcomer at the 1999 British Comedy Awards for The 11 O'Clock Show. He created and starred in Da Ali G Show (2000–2004), receiving two BAFTA Awards. His next television project, Who Is America? (2018) for Showtime, saw him nominated for a Golden Globe Award for Best Actor – Television Series Musical or Comedy. In 2019, he portrayed Eli Cohen in the limited series The Spy for OCS and Netflix, for which he received a nomination for the Golden Globe Award for Best Actor - Miniseries or Television Film.\n\nBaron Cohen has two nominations for the Academy Award for Best Adapted Screenplay, three Golden Globe Award nominations, resulting in two wins for Best Actor – Motion Picture Musical or Comedy for his work in the feature film Borat and its sequel. In 2021, he received Academy Award, Golden Globe Award, and Screen Actors Guild Award nominations for his performance as Abbot "Abbie" Hoffman in The Trial of the Chicago 7. He has been a member of the Academy of Motion Picture Arts and Sciences in the Actors Branch since 2008. After the release of Borat, Baron Cohen said he would retire Borat and Ali G because the public had become too familiar with the characters. After the release of Brüno, he said he would retire that character. However, the character of Borat was brought back for the 2020 sequel Borat Subsequent Moviefilm.\n\nDescription above from the Wikipedia article Sacha Baron Cohen, licensed under CC-BY-SA, full list of contributors on Wikipedia.	GBR	/8J2LxfW3owPTc9OzbBoUbADFOBb.jpg
3911	nm0002253	John Carroll Lynch	2	1963-08-01 00:00:00	\N	John Carroll Lynch (born August 1, 1963) is an American actor, known for his role as Drew Carey's cross-dressing brother on The Drew Carey Show, and for his role as Norm, the unassuming husband of Margie Gunderson (Frances McDormand) in Fargo.\n\nIn the fall of 2003, he starred in the CBS show The Brotherhood of Poland, New Hampshire, with Randy Quaid, Chris Penn, Mare Winningham, Elizabeth McGovern, and Ann Cusack. The show was cancelled after only a few episodes. He also had a recurring role in the HBO show Carnivàle, playing escaped convict Varlyn Stroud. Lynch appeared as a district attorney in the CBS series Close to Home and as NASA official Bob Gilruth in the HBO mini-series From the Earth to the Moon. Lynch appeared in the 2003 thriller Gothika and the 2007 biopic Zodiac.	USA	/cIx1HYFOHmfeAGRDBJwdFK9ZMIM.jpg
