33	nm0000641	Gary Sinise	2	1955-03-17 00:00:00	\N	Gary Alan Sinise (born March 17, 1955) is an American actor, film director, humanitarian, and musician. Among other awards, he has won a Primetime Emmy Award, a Golden Globe Award, a Tony Award, and four Screen Actors Guild Awards. He has also received a star on the Hollywood Walk of Fame, and was nominated for an Academy Award.\n\nHe has also received numerous awards and honors for his extensive humanitarian work and involvement with charitable organizations. He is a supporter of various veterans' organizations and founded the Lt. Dan Band (named after his character in Forrest Gump), which plays at military bases around the world.\n\nHis acting career started on stage with the Steppenwolf Theatre Company in 1983 when he directed and starred in a production of Sam Shepard's True West for which he earned a Obie Award. He would later earn four Tony Award nominations including for his performances in The Grapes of Wrath and One Flew Over the Cuckoo's Nest. He earned the Tony Award's Regional Theatre Award alongside the Steppenwolf Theatre Company.\n\nHe first starred in the film adaptation of John Steinbeck's classic novel Of Mice and Men which he also directed and produced. Sinise played George Milton alongside John Malkovich who played Lennie.\n\nOne of his most well-known roles is as Lieutenant Dan Taylor in Forrest Gump (1994) for which he was nominated for the Academy Award for Best Supporting Actor. He also appeared in other feature films including Ron Howard's Apollo 13 (1995), Ransom (1996), Frank Darabont's The Green Mile (1999) and Impostor (2002).\n\nHis television performances include Harry S. Truman in Truman  (1995), for which he won a Golden Globe, and the title role in the television film George Wallace, for which he received a Primetime Emmy Award.\n\nHe had a leading role as Detective Mac Taylor in the CBS drama series CSI: NY (2004–13). From 2016 to 2017, he starred as Special Agent Jack Garrett in Criminal Minds: Beyond Borders. In 2017, he had a role on the Netflix series 13 Reasons Why.\n\nHe has also been a narrator on multiple docuseries and documentaries.	USA	/ngYV91xYfCu0JNcSxJ4yQ7tzOna.jpg
35	nm0000398	Sally Field	1	1946-11-06 00:00:00	\N	Sally Margaret Field (born November 6, 1946) is an American actress. She has received many awards and nominations, including two Academy Awards, three Primetime Emmy Awards, two Golden Globe Awards, a Screen Actors Guild Award, a Cannes Film Festival Award for Best Actress, and nominations for a Tony Award and for two British Academy Film Awards.\n\nField began her career on television, starring in the comedies Gidget (1965–1966), The Flying Nun (1967–1970), and The Girl with Something Extra (1973–1974). In 1967, she was also in the western The Way West. In 1976, she attracted critical acclaim for her performance in the television film Sybil, for which she received the Primetime Emmy Award for Outstanding Lead Actress in a Limited Series or Movie. Her film debut was as an extra in Moon Pilot (1962). Her film career escalated during the 1970s with starring roles in films including Stay Hungry (1976), Smokey and the Bandit (1977), Heroes (1977), The End (1978), and Hooper (1978). During the 1980s she won the Academy Award for Best Actress twice for Norma Rae (1979) and Places in the Heart (1984), and she appeared in Smokey and the Bandit II (1980), Absence of Malice (1981), Kiss Me Goodbye (1982), Murphy's Romance (1985), Steel Magnolias (1989), Soapdish (1991), Mrs. Doubtfire (1993), and Forrest Gump (1994).\n\nIn the 2000s, Field returned to television with a recurring role on the NBC medical drama ER, for which she won the Primetime Emmy Award for Outstanding Guest Actress in a Drama Series in 2001 and the following year made her stage debut with Edward Albee's The Goat, or Who Is Sylvia?. For her portrayal of Nora Walker in the ABC television family drama series Brothers & Sisters (2006-2011), Field won the Primetime Emmy Award for Outstanding Lead Actress in a Drama Series. She starred as Mary Todd Lincoln in Lincoln (2012), for which she was nominated for the Academy Award for Best Supporting Actress, and she portrayed Aunt May in The Amazing Spider-Man (2012) and its 2014 sequel, with the first being her highest-grossing release. In 2015, she portrayed the title character in Hello, My Name Is Doris, for which she was nominated for the Critics' Choice Movie Award for Best Actress in a Comedy. In 2017, she returned to the stage after an absence of 15 years with the revival of Tennessee Williams's The Glass Menagerie, for which was nominated for the Tony Award for Best Actress in a Play. In 2014, she was presented with a star on the Hollywood Walk of Fame and in 2019, she received the Kennedy Center Honor.	USA	/5fBK36MdmdwQQMuP0W70rXADXih.jpg
34	nm0932112	Mykelti Williamson	2	1957-03-04 00:00:00	\N	Michael T. 'Mykelti' Williamson (born March 4, 1957) is an American actor best known for his role as Benjamin Buford 'Bubba' Blue in the 1994 film Forrest Gump, as Detective Bobby 'Fearless' Smith in the critically acclaimed but commercially unsuccessful crime drama Boomtown, and recently for appearing as the head of CTU for season 8 of the hit TV series 24.	USA	/8TnU8lT8uJp97vKi5AluaQFuTZI.jpg
9640	nm0005286	Haley Joel Osment	2	1988-04-10 00:00:00	\N	Haley Joel Osment (born April 10, 1988) is an American actor. After a series of roles in television and film during the 1990s, including a small part in Forrest Gump playing the title character’s son, Osment rose to fame with his performance as Cole Sear in M. Night Shyamalan’s thriller film The Sixth Sense that earned him a nomination for Academy Award for Best Supporting Actor. He subsequently appeared in leading roles in several high-profile Hollywood films including Steven Spielberg's A.I. Artificial Intelligence and Mimi Leder's Pay it Forward. He made his Broadway debut in 2008 in a revival of American Buffalo, co-starring with John Leguizamo and Cedric the Entertainer.	USA	/jft0dGgR5bJ6mR7QRYriMVBC6QH.jpg
