42961	nm0522550	Jacqueline Lovell	1	1974-12-09 00:00:00	\N	Jacqueline Lovell (born 9 December 1974) is an American actress born and raised in Southern California. Most of her roles have been in B-films and erotic movies.  From a very young age, she had the immense innate talent and enthusiasm for performance. She expressed this through school musicals and church plays from grade school through high school. In much of her free time, she was writing skits and performing them for her family. She attended many schools during her formative years, which instilled drive and independence in her. At eighteen, she went to Santa Monica College to pursue accounting and later landed a full time job as an accountant.\n\nHowever, she quickly realized her hunger was not being fulfilled. So she set sail and journeyed into the world of modeling. She quickly became the number one nude model in 1995 and was in over 150 magazines by '96. She completed more than 80 videos for Playboy, Penthouse and numerous independents.  After being in the industry for one year, Jacqueline's desire to grow as a person led her to acting classes. As she studied her craft, her vocation became clear. She was cast in lead roles for Full Moon Entertainment, Zalman King Productions, Mystique Films, and many more.	USA	/vIXpalWXdJZBsnS3zkjQZMjnV1L.jpg
