2023611	\N	Aylam Orian	2	1968-09-04 00:00:00	\N	Aylam Orian (pronounced Eiy-lahm Or-yahn) was born in Cleveland, Ohio, to Israeli parents of Polish, Russian, and Romanian descent. Soon after his birth, the family moved back to Israel where he grew up as an artistic kid, taking up painting, sculpting, photography and playing the guitar. But it wasn't until after his military service of 4.5 years that he decided to give art a serious try and enrolled in Tel Aviv University Film School. A short film he made there, A Nightmare on Bialik Street (1994) (a witty homage to the famous Russian film Battleship Potemkin (1925)), won several prizes and was later shown at the Cannes Film Festival. While acting in his own films, Aylam caught the 'acting bug' and so in early 2000 he returned to the US to study acting at The Lee Strasberg Theatre and Film Institute, and later The Stella Adler Studio of Acting in New York.\n\nWhile a student at the Strasberg Institute, he was hired to organize and preserve Strasberg's extensive collections of materials on acting - a position he held for the next 9 years, before starting to teach there. Upon graduating, he made his TV debut in the A&E mini-series Between the Lines (2004) hosted by Robert Downey Jr., where he joined the ranks of Hillary Clinton, John Goodman and Priscilla Presley in reading unknown letters written by famous people - his was no other than a love letter written by a young Adolf Hitler. Soon after, he played the leading role of a fugitive on the popular Fox show America's Most Wanted: America Fights Back (1988). He also wrote, produced and played the leading role in the movement-theatre show and film Beautiful World... (2006). Other film and TV roles followed, such as in the independent films Color of Truth (2009), Joy Incorporated (2012), Keep the Lights On (2012), and The Cold Winter (2016); the CBS film In God's Name (2007), and the hit NBC comedy show 30 Rock (2006), before Aylam made his way to Los Angeles.\n\nThere,