3894	nm0000288	Christian Bale	2	1974-01-30 00:00:00	\N	Christian Charles Philip Bale (born 30 January 1974) is an English actor. Known for his versatility and physical transformations for his roles, he has been a leading man in films of several genres. He has received various accolades, including an Academy Award and two Golden Globe Awards. Forbes magazine ranked him as one of the highest-paid actors in 2014.\n\nBorn in Wales to English parents, Bale had his breakthrough role at age 13 in Steven Spielberg's 1987 war film Empire of the Sun. After more than a decade of performing in leading and supporting roles in films, he gained wider recognition for his portrayals of serial killer Patrick Bateman in the black comedy American Psycho (2000) and the titular role in the psychological thriller The Machinist (2004). In 2005, he played superhero Batman in Batman Begins and again in The Dark Knight (2008) and The Dark Knight Rises (2012), garnering acclaim for his performance in the trilogy, which is one of the highest-grossing film franchises.\n\nBale continued in starring roles in a range of films outside his work as Batman, including the period drama The Prestige (2006), the action film Terminator Salvation (2009), the crime drama Public Enemies (2009), the epic film Exodus: Gods and Kings (2014) and the superhero film Thor: Love and Thunder (2022). For his portrayal of boxer Dicky Eklund in the 2010 biographical film The Fighter, he won an Academy Award and a Golden Globe Award. Further Academy Award and Golden Globe Award nominations came for his work in the black comedy American Hustle (2013) and the biographical dramedies The Big Short (2015) and Vice (2018). His performances as politician Dick Cheney in Vice and race car driver Ken Miles in the sports drama Ford v Ferrari (2019) earned him a second win and a fifth nomination respectively at the Golden Globe Awards.	GBR	/b7fTC9WFkgqGOv77mLQtmD4Bwjx.jpg
1892	nm0000354	Matt Damon	2	1970-10-08 00:00:00	\N	Matthew Paige Damon (born October 8, 1970) is an American actor, film producer, and screenwriter. He is the recipient of various accolades, including an Academy Award from five nominations, and two Golden Globe Awards. He also received three BAFTA Award nominations, seven Primetime Emmy Award nominations, and six Screen Actors Guild Awards.\n\nDamon began his acting career by appearing in high school theater productions. He made his professional acting debut in the film Mystic Pizza (1988). He came to prominence in 1997 when he and Ben Affleck wrote and starred in Good Will Hunting, which won them the Academy and Golden Globe awards for Best Screenplay. He continued to garner praise from critics for his roles as the title character in Saving Private Ryan (1998), the antihero in The Talented Mr. Ripley (1999), an energy analyst in Syriana (2005), a corrupt Irish-American policeman in The Departed (2006), rugby player Francois Pienaar in Invictus (2009), Scott Thorson in Behind The Candelabra (2013), an astronaut stranded on Mars in The Martian (2015), and race car designer Carroll Shelby in Ford v Ferrari (2019).\n\nDamon is also known for his starring roles as Jason Bourne in the Bourne franchise (2002–2016), and as con man Linus Caldwell in the Ocean's trilogy (2001–2007). He produced the reality series Project Greenlight (2001–2015) as well as the film Manchester by the Sea (2016).	USA	/lL1bN9lszEqcUDD73560cc64wO2.jpg
6164	nm0524197	Josh Lucas	2	1971-06-20 00:00:00	\N	Over his career, Josh Lucas has worked with many of the film community's greatest talents. He has starred alongside Jon Voight in Jerry Bruckheimer's Glory Road (2006), for which Lucas added 40 pounds to transform himself into legendary basketball coach Don Haskins. Lucas also starred with Kurt Russell and Richard Dreyfuss in Wolfgang Petersen's Poseidon (2006). He starred with Morgan Freeman and Robert Redford in Lasse Hallström's An Unfinished Life (2005). He also starred opposite Jamie Bell in David Gordon Green's Undertow (2004), which was also produced by Terrence Malick. Additionally, Lucas worked alongside Christopher Walken in Around the Bend (2004).\n\nHe performed with Jennifer Connelly and Eric Bana in Ang Lee's Hulk (2003). He was in Ron Howard's Oscar-winning A Beautiful Mind (2001) with Russell Crowe. Plus, he starred opposite Reese Witherspoon in the Walt Disney Company's smash hit Sweet Home Alabama (2002). Other credits include Wonderland (2003), The Deep End (2001), American Psycho (2000), Session 9 (2001), and You Can Count on Me (2000).\n\nLucas' theater credits include the recent off-Broadway run of "Spalding Gray: Stories Left to Tell"; Tennessee Williams' "The Glass Menagerie," which appeared on Broadway in 2005; Terrence McNally's "Corpus Christi" at the Manhattan Theater Club; Christopher Shinn's "What Didn't Happen"; and "The Picture of Dorian Gray."\n\nLucas recently completed his second collaboration with documentary filmmaker Ken Burns on "The War" (2007). Lucas' other documentary work includes the upcoming Operation Homecoming: Writing the Wartime Experience (2007), Trumbo (2007), and Resolved (2007).  Lucas recently completed his first venture into production with Stolen Lives (2009), in which he plays the single father of a mentally challenged boy. This film is the first project to be produced through Lucas' production company, Two Bridges.\n\nLucas resides in New York City.	USA	/fNCvgTrXHG07cPcY7wPz4KtqSfW.jpg
