55934	nm0169806	Taika Waititi	2	1975-08-16 00:00:00	\N	Taika David Cohen ONZM (born 16 August 1975), known professionally as Taika Waititi, is a New Zealand film and television director, producer, screenwriter, actor, and comedian. He is the recipient of an Academy Award, BAFTA Award and a Grammy Award, and has been nominated for two Primetime Emmy Awards. His feature films Boy (2010) and Hunt for the Wilderpeople (2016) have each been the top-grossing New Zealand film.\n\nWaititi's 2004 short film Two Cars, One Night earned him an Academy Award nomination for Best Live Action Short Film. He co-directed and starred in the horror comedy film What We Do in the Shadows (2014) with Jemaine Clement, which was adapted into a television series of the same name (2019–present). The series has been nominated for the Primetime Emmy Award for Outstanding Comedy Series. His most recent directing credits include the superhero film Thor: Ragnarok (2017) and the black comedy film Jojo Rabbit (2019), the latter of which he also wrote and starred in as an "imaginary Hitler". Jojo Rabbit received six Academy Award nominations and won for Best Adapted Screenplay. Furthermore, Waititi earned a Grammy Award for producing the film's soundtrack. In addition to directing an episode of the television series The Mandalorian (2019–present), he also voices the character IG-11, for which he garnered a Primetime Emmy Award nomination for Outstanding Character Voice-Over Performance.	NZL	/aH6MgwFhomAPNBRPyO2fhpU5kbk.jpg
6807	nm0005377	Sam Rockwell	2	1968-11-05 00:00:00	\N	Sam Rockwell was born on November 5, 1968, in San Mateo, California, the only child of two actors, Pete Rockwell and Penny Hess. The family moved to New York when he was two years old, living first in the Bronx and later in Manhattan. When Sam was five years old, his parents separated, at which point he and his father moved to San Francisco, where he subsequently grew up, while summers and other times were spent with his mother in New York.\n\nHe made his acting debut when he was ten years old, alongside his mother, and later attended J Eugene McAteer High School in a program called SOTA. While still in high school, he got his first big break when he appeared in the independent film Clownhouse (1989). The plot revolved around three escaped mental patients who dressed up as clowns and terrorized three brothers home alone--Sam played the eldest of the brothers. His next big break was supposed to have come when he was slated to star in a short-lived NBC TV-series called Dream Street (1989), but he was soon fired.\n\nAfter graduating from high school, Sam returned to New York for good and for two years he had private training at the William Esper Acting Studio. During this period he appeared in a variety of roles, such as the ABC Afterschool Specials (1972): Over the Limit (1990) (TV) and HBO's Lifestories: Families in Crisis (1992): Dead Drunk: The Kevin Tunell Story (Season 1 Episode 7: 15 March 1993); the head thug in Teenage Mutant Ninja Turtles (1990); and a guest-star turn in an Emmy Award-winning episode of Law & Order (1990), while working a string of regular day jobs and performing in plays.\n\nHis performances in The Green Mile (1999) and Galaxy Quest (1999) wowed audiences and critics alike with his chameleon-like performances as a crazed killer in the former and a goofy actor in the latter.\n\nMore recently, he appeared in another string of mainstream films, most notably as Eric Knox in Charlie's Angels (2000) and as Zaphod Beeblebrox in The Hitchhiker's Guide to the Galaxy (2005), while continuing to perform in smaller independent movies. After more than ten years in the business, Sam has earned his success. In 2018, he won an Academy Award for Best Supporting Actor as a troubled police deputy in Three Billboards Outside Ebbing, Missouri (2017).	USA	/vYpWxV0bnUgKo7SdasfGP9HttUq.jpg
221581	nm2313103	Rebel Wilson	1	1980-03-02 00:00:00	\N	Rebel Melanie Elizabeth Wilson (born March 2, 1980) is an Australian actress, comedian, writer, and producer. After graduating from the Australian Theatre for Young People in 2003, she began appearing as Toula in the Special Broadcasting Service (SBS) comedy series Pizza (2003–2007; 2019), and subsequently appeared in the sketch comedy series The Wedge (2006–2007). Wilson wrote, produced and starred in the musical comedy series Bogan Pride (2008). The following year, she won the Tropfest best actress award for her role in Bargain and made a guest appearance in City Homicide. Shortly after moving to the United States, Wilson appeared as Brynn in the feature film Bridesmaids (2011).\n\nIn 2012, Wilson appeared in the films What to Expect When You're Expecting, Struck by Lightning, and Bachelorette, which led to Variety naming her one of their “Top Ten Comics to Watch for 2012”. She also played the role of Fat Amy in the musical comedy Pitch Perfect film series (2012–2017), which earned her several award nominations and wins, including the MTV Movie Award for Best Breakthrough Performance and a Teen Choice Award for Choice Movie Actress. In 2016, Wilson appeared in the films How to Be Single and Grimsby.\n\nWilson wrote and starred in Super Fun Night (2013), a television sitcom that aired for one season on ABC. In 2019, she starred in her first lead role as Natalie in Isn't It Romantic, and went on to play Penny Rust in The Hustle, Jennyanydots in Cats, and Fraulein Rahm in Jojo Rabbit.	AUS	/6iAFqhVcOSLjeZq83mONpx99NAQ.jpg
