17490	nm0926086	Isiah Whitlock Jr.	2	1954-09-13 00:00:00	\N	Isiah Whitlock Jr. (born September 13, 1954) is an American actor. He is most famous for his role on the HBO television series, The Wire as corrupt state senator Clay Davis. In 2011, Whitlock played an insurance agent named Ronald Wilkes in the film Cedar Rapids. Wilkes is a self-described fan of The Wire and does an impersonation of character Omar Little. Whitlock has said that the references to the series were written in before he became involved in Cedar Rapids.\n\nHe is also notable for appearing in Spike Lee films She Hate Me and 25th Hour as Agent Amos Flood. In all three projects, Whitlock established a catchphrase from his characters' distinct pronunciation of the word "shit" ("sheee-it").\n\nHe appeared as Eugine, a supporting role, in the 2003 film Pieces of April. He had a bit part in Goodfellas as a doctor who gives Henry Hill a Valium while attending to his brother. In 2007, he played Ethan Banks in Enchanted.\n\nWhitlock has made appearances on Chappelle's Show and has played various characters on Law & Order and its' spinoff, Law & Order: SVU. He also appears in promotional spots for the Wii video game Punch-Out!! portraying the character Doc Louis.	USA	/8OIhQb53rMX7VcTLZbAMeVd7tHc.jpg
31512	nm0121559	Robert John Burke	2	1960-09-12 00:00:00	\N	A born-and-bred New Yorker, Robert John Burke made his film debut while in his early 20s with a small part in the drama "The Chosen" (1981), based on the Chaim Potok story. He went on to study acting at SUNY Purchase where he met aspiring filmmaker Hal Hartley, who cast him as one of the leads in his debut feature "The Unbelievable Truth," an offbeat indie tale where he played a man trying to escape his troubled past. Working with Hartley again on the charming brother-centric dark comedy "Simple Men," Burke caught a major break when Hollywood producers decided that his chiseled jawline was the right one to replace Peter Weller's in the sci-fi/action sequel "RoboCop 3." Despite Burke's efforts, the movie tanked, and he went on to smaller roles in major films, including the lauded Western "Tombstone" (1993) and the prison-break movie "Fled" (1996). Burke landed his second chance in a Hollywood starring role with the Stephen King adaptation "Thinner" (1996), but the macabre tale, which featured him under heavy makeup to depict a callous man who magically loses weight, was deemed almost universally unlikable.Though Burke's leading-man days were mostly behind him, his beastly role in Hartley's "No Such Thing" (2001) aside, he soldiered on, and began increasingly working on television with recurring roles on the grim prison drama "Oz" and the police procedural "Law & Order: Special Victims Unit" (NBC, 1999- ). Appearing in George Clooney's first two movies as director, "Confessions of a Dangerous Mind" (2002) and "Good Night, and Good Luck." (2005), Burke nonetheless became more familiar to TV audiences, particularly when he signed on to play Mickey Gavin, the ex-priest cousin of Denis Leary's lead character on the firefighter series "Rescue Me," a part that dovetailed with Burke's real-life second job as a New York State fireman.Often cast as a tough guy, the ruggedly handsome and tall actor continued to play imposing figures such as Major General James "Chaos" Mattis in the Iraq War miniseries "Generation Kill" (HBO, 2008) and Bart Bass, the controlling billionaire father of Chuck Bass (Ed Westwick) on the soapy drama "Gossip Girl." Before long, he was juggling his ongoing "Law & Order: SVU" part with regular spots on the military drama "Army Wives" (Lifetime, 2007- ) and the tense crime show "Person of Interest" (CBS, 2011- ), while still finding time for supporting turns in films, including the Denzel Washington/Mark Wahlberg action movie "2 Guns" (2013).	USA	/4uCjxK6QmPW98W56aCldwINSOcX.jpg
