135651	nm0430107	Michael B. Jordan	2	1987-02-09 00:00:00	\N	Michael Bakari Jordan (born February 9, 1987) is an American actor, producer and director. He is best known for his film roles as shooting victim Oscar Grant in the drama Fruitvale Station (2013), boxer Adonis Creed in Creed (2015), and Erik Killmonger in Black Panther (2018), all of which were written and directed by Ryan Coogler. Jordan reprised his role of Creed in Creed II (2018) and Creed III (2023); the latter also marked his directorial debut.\n\nJordan initially broke out in television, playing Wallace in the first season of the HBO crime drama series The Wire (2002). He went on to play Reggie Montgomery on the ABC soap opera All My Children (2003–2006) and Vince Howard in the NBC sports drama series Friday Night Lights (2009–2011). His other films include Chronicle (2012), That Awkward Moment (2014), Fantastic Four (2015), and Just Mercy (2019), in which he portrayed Bryan Stevenson. He has also starred in and produced the HBO film Fahrenheit 451 (2018), for which he was nominated for the Primetime Emmy Award for Outstanding Television Movie.	USA	/kfcn0yyEdN2aJfVaxW0NIoKVF4J.jpg
1267329	nm2143282	Lupita Nyong'o	1	1983-03-01 00:00:00	\N	Lupita Amondi Nyong'o (born 1 March 1983) is a Kenyan-Mexican actress and author. She began her career in Hollywood as a production assistant. In 2008, she made her acting debut with the short film East River and subsequently returned to Kenya to star in the television series Shuga (2009–2012). In 2009, she wrote, produced and directed the documentary In My Genes. She then pursued a master's degree in acting from the Yale School of Drama.\n\nShe had her first feature film role as Patsey in 12 Years a Slave (2013), for which she received critical acclaim and won several awards, including the Academy Award for Best Supporting Actress. She became the first Kenyan and Mexican actress to win an Academy Award. She made her Broadway debut as a teenage orphan in the play Eclipsed (2015), for which she was nominated for a Tony Award for Best Actress in a Play. She went on to perform a motion capture role as Maz Kanata in the Star Wars sequel trilogy (2015–2019) and a lead voice role as Raksha in The Jungle Book (2016). Her career progressed with her role as Nakia in the Marvel Cinematic Universe superhero film Black Panther (2018) and her starring role in Jordan Peele's critically acclaimed horror film Us (2019).\n\nIn addition to acting, she supports historic preservation. She is vocal about preventing sexual harassment and working for women's and animal rights. In 2014, she was named the most beautiful woman by People. She has also written a children's book named Sulwe (2019), which became a number-one New York Times Best-Seller. Also in 2019, she narrated the Discovery Channel docu-series Serengeti, which earned her a Primetime Emmy Award nomination for Outstanding Narrator. She was named among Africa's "50 Most Powerful Women" by Forbes in 2020.\n\nDescription above is from the Wikipedia article Lupita Nyong'o, licensed under CC-BY-SA, full list of contributors on Wikipedia.	MEX	/mJMpsADPpt0bmXEzs3ywrUiCkpD.jpg
