7060	nm0293509	Martin Freeman	2	1971-09-08 00:00:00	\N	Martin John Christopher Freeman is an English actor. Among other accolades, he has won an Emmy Award, a BAFTA Award and a Screen Actors Guild Award, and has been nominated for a Golden Globe Award.\n\nFreeman's most notable roles are that of Tim Canterbury in the mockumentary series The Office (2001–2003), Dr. John Watson in the British crime drama series Sherlock (2010–2017), Bilbo Baggins in The Hobbit film trilogy (2012–2014), and Lester Nygaard in the first season of the dark comedy-crime drama series Fargo (2014).\n\nHe has also appeared in films including the romantic comedy Love Actually (2003), the horror comedy Shaun of the Dead (2004), the sci-fi comedy The Hitchhiker's Guide to the Galaxy (2005), the action comedy Hot Fuzz (2007), the semi-improvised comedy Nativity! (2009), the sci-fi comedy The World's End (2013).\n\nFor the last few years he has been playing Everett K. Ross in the Marvel Cinematic Universe superhero films Captain America: Civil War (2016), Black Panther (2018), and Black Panther: Wakanda Forever (2022). He will reprise the role in the upcoming Disney+ series Secret Invasion (2023).	GBR	/pLG7mmxBXXTVAgzXvQl0ap3qlJU.jpg
1083010	nm4004793	Letitia Wright	1	1993-10-31 00:00:00	\N	Letitia Michelle Wright (born 31 October 1993) is a Guyanese-British actress. Beginning her professional career in 2011, she has played roles in several British TV series, including Top Boy (2011), Coming Up (2013), Chasing Shadows (2014), Humans (2016), the Doctor Who episode "Face the Raven" (2015) and the Black Mirror episode "Black Museum" (2017); for the latter, she received a Primetime Emmy Award nomination for Outstanding Supporting Actress in a Limited Series or Movie.\n\nThe British Academy of Film and Television Arts named Wright among the 2015 group of BAFTA Breakthrough Brits for her role in the award-winning film Urban Hymn (2015). In 2018, she achieved global recognition for her portrayal of Shuri in the Marvel Cinematic Universe film Black Panther. She reprised the role in Avengers: Infinity War (2018), Avengers: Endgame (2019) and Black Panther: Wakanda Forever (2022). In 2019, she received the BAFTA Rising Star Award.\n\nDescription above is from the Wikipedia article Letitia Wright, licensed under CC-BY-SA, full list of contributors on Wikipedia.	GUY	/p8acjtsBrj2VPAgAIUhxHYrMa7U.jpg
