51878	nm0437689	John Kani	2	1943-11-30 00:00:00	\N	​From Wikipedia, the free encyclopedia.  \n\nBonsile John Kani (born 1943) is a South African actor, director and playwright. He was born in New Brighton, South Africa. Kani joined The Serpent Players (a group of actors whose first performance was in the former snake pit of the zoo, hence the name) in Port Elizabeth in 1965 and helped to create many plays that went unpublished but were performed to a resounding reception. These were followed by the more famous Sizwe Banzi is Dead and The Island, co-written with Athol Fugard and Winston Ntshona, in the early 1970s. He also received an Olivier nomination for his role in My Children My Africa! Kani's work has been widely performed around the world, including New York, where he and Winston Ntshona won a Tony Award in 1975 for Sizwe Banzi Is Dead and The Island. These two plays were presented in repertory at the Edison Theatre for a total of 52 performances. Nothing but the Truth (2002) was his debut as sole playwright and was first performed in the Market Theatre in Johannesburg. This play takes place in post-apartheid South Africa and does not concern the conflicts between whites and blacks, but the rift between blacks who stayed in South Africa to fight apartheid, and those who left only to return when the hated regime folded. It won the 2003 Fleur du Cap Awards for best actor and best new South African play. In the same year he was also awarded a special Obie award for his extraordinary contribution to theatre in the USA. Kani is executive trustee of the Market Theatre Foundation, founder and director of the Market Theatre Laboratory and chairman of the National Arts Council of SA.\n\nDescription above from the Wikipedia article John Kani, licensed under CC-BY-SA, full list of contributors on Wikipedia.	ZAF	/g7tqg3q128a5O2qXMCwVnXsow9I.jpg
9780	nm0000291	Angela Bassett	1	1958-08-16 00:00:00	\N	Angela Evelyn Bassett (born August 16, 1958) is an American actress. Known for her work in film and television since the late 1980s, she has received various accolades, including two Golden Globe Awards, in addition to nominations for two Academy Awards and seven Primetime Emmy Awards.\n\nBassett had her breakthrough portraying singer Tina Turner in the biopic What's Love Got to Do with It (1993), which won her a Golden Globe Award and a nomination for the Academy Award for Best Actress. This led to starring roles as Betty Shabazz in Malcolm X (1992), as the mother of The Notorious B.I.G. in Notorious (2009), and as Amanda Waller in Green Lantern (2011). Her other notable film roles were in Boyz n the Hood (1991), Waiting to Exhale (1995), Vampire in Brooklyn (1995), How Stella Got Her Groove Back (1998), Music of the Heart (1999), Olympus Has Fallen (2013) and London Has Fallen (2016). She has also played Queen Ramonda in the Marvel Cinematic Universe films Black Panther (2018), Avengers: Endgame (2019), and Black Panther: Wakanda Forever (2022). For the latter, she won a Golden Globe Award and has been nominated for the Academy Award for Best Supporting Actress.\n\nOn television, Bassett has starred as Katherine Jackson in the miniseries The Jacksons: An American Dream (1992). Her portrayal of Rosa Parks in the television film The Rosa Parks Story (2002) gained her a nomination for a Primetime Emmy Award for Outstanding Lead Actress. Her performances in two seasons of the FX horror anthology series American Horror Story, earned her nominations for a Primetime Emmy Award for Outstanding Supporting Actress in 2014 and 2015. In 2018, Bassett began producing and starring as an LAPD patrol sergeant in the Fox drama series 9-1-1.	USA	/7Oz53NKdglRzAzI2MKjM3eQXwn.jpg
2178	nm0001845	Forest Whitaker	2	1961-07-15 00:00:00	\N	Forest Steven Whitaker (born July 15, 1961) is an American actor, producer, director, and activist. He is the recipient of various accolades, including an Academy Award, a Golden Globe Award, a British Academy Film Award, and two Screen Actors Guild Awards.\n\nAfter making his film debut in Fast Times at Ridgemont High (1982), Whitaker went on to earn a reputation for intensive character study work for films, such as Platoon (1986), Good Morning, Vietnam (1987), Bird (1988), The Crying Game (1992), Phenomenon (1996), Ghost Dog: The Way of the Samurai (1999), The Great Debaters (2007), The Butler (2013), Arrival (2016), and Respect (2021). He has also appeared in blockbusters, such as Panic Room (2002), Rogue One: A Star Wars Story (2016) as Saw Gerrera, and Black Panther (2018) as Zuri. For his portrayal of Ugandan dictator Idi Amin in the British historical drama film The Last King of Scotland (2006), Whitaker won the Academy Award for Best Actor. Whitaker made his directorial debut with the television film Strapped (1993), and directed the films Waiting to Exhale (1995), Hope Floats (1998), and First Daughter (2004).\n\nApart from his film career, Whitaker is also known for his humanitarian work and activism. In 2011, he was inducted as a UNESCO Goodwill Ambassador, later receiving a promotion to Special Envoy for Peace and Reconciliation, and serves as the CEO of Whitaker Peace and Development Initiative (WPDI), a non-profit outreach program.\n\nDescription above from the Wikipedia article Forest Whitaker, licensed under CC-BY-SA, full list of contributors on Wikipedia.	USA	/fugyEeN6sisuYi07HSoxdVHm0CZ.jpg
1333	nm0785227	Andy Serkis	2	1964-04-20 00:00:00	\N	Andrew Clement Serkis (born 20 April 1964) is an English actor, director and producer of Iraqi and Armenian descent. He is best known for his performance capture roles comprising motion capture acting, animation, and voice work for computer-generated characters such as Gollum in The Lord of the Rings film trilogy (2001–2003) and The Hobbit: An Unexpected Journey (2012), King Kong in the eponymous 2005 film, Caesar in the Planet of the Apes reboot series (2011–2017), Captain Haddock / Sir Francis Haddock in Steven Spielberg's The Adventures of Tintin (2011), and Supreme Leader Snoke in the Star Wars sequel trilogy films The Force Awakens (2015) and The Last Jedi (2017). In 2018, he portrayed the character of Baloo in his self-directed film, Mowgli: Legend of the Jungle.\n\nSerkis is one of the highest-grossing actors of all time, number ten, and his film work in motion capture has been critically acclaimed. He has received an Empire Award and two Saturn Awards for his motion-capture acting. He earned a Golden Globe nomination for his portrayal of serial killer Ian Brady in the British television film Longford (2006) and was nominated for a BAFTA for his portrayal of new wave and punk rock musician Ian Dury in the biopic Sex & Drugs & Rock & Roll (2010). In 2020, Serkis received the BAFTA Award for Outstanding British Contribution To Cinema. In 2021, he won a Daytime Emmy Award for the series The Letter for the King (2020).\n\nSerkis portrayed Ulysses Klaue in the Marvel Cinematic Universe films Avengers: Age of Ultron (2015) and Black Panther (2018). He also played Alfred Pennyworth in The Batman (2022). Serkis has his own production company and motion capture workshop, The Imaginarium in London, which he used for Mowgli: Legend of the Jungle. He made his directorial debut with Imaginarium's 2017 film Breathe. He directed Venom: Let There Be Carnage (2021), which is set in Sony's Spider-Man Universe.	GBR	/eNGqhebQ4cDssjVeNFrKtUvweV5.jpg
