1431508	nm3571491	Sope Aluko	1	\N	\N	Sope Aluko ("Shaw-peh Ah-loo-koh") was born in Nigeria (West Africa). Sope is a multilingual, dual citizen of both the US and the UK. She speaks five languages, including her native language, Yoruba/Nigerian, French, and Bahasa/Indonesian.\n\nSope's early years were spent living in some of the most beautiful countries in the world, including France, Switzerland, Tanzania, Trinidad & Tobago, and Indonesia. Her father being in the diplomatic service, exposed Sope and her sisters to appreciate the beauty of these countries, as well as the people, their languages, struggles and politics. Sope reflects that she and her sisters grew up feeling like "gypsy children" in the best possible way. All the world was a classroom and the people were their teachers.\n\nAs early as she could talk, Sope loved to perform. She decided as a very young girl that she would be an actor. Sope cultivated her acting chops in the UK, primarily Shakespearean stage plays, certified by the London Academy of Music and Dramatic Arts (LAMDA) and the Royal Academy of Dramatic Arts (RADA).\n\nAs an extended artistic expression to her acting, Sope studied various forms of dance, including Balinese and African dance. She had the privilege of performing the world famous South African "Ipi Tombi" dance at the National Arts Theater in Nigeria.\n\nA lover of education, Sope obtained an undergraduate degree in Engineering and Master's degree in Marketing. She had a successful corporate career in England and America for several years before returning to her acting career. Sope is a wife and mom of two young boys and lives in Los Angeles and Miami.\n\n- IMDb Mini Biography	\N	/dNfAM8jNgwa1693nuplfjp70Ls4.jpg
7624	nm0498278	Stan Lee	2	1922-12-28 00:00:00	2018-11-12 00:00:00	Stan Lee (born Stanley Martin Lieber, December 28, 1922 – November 12, 2018) was an American comic book writer, editor, actor, producer, publisher, television personality, and the former president and chairman of Marvel Comics.\n\nIn collaboration with several artists, most notably Jack Kirby and Steve Ditko, he co-created Spider-Man, the Fantastic Four, the X-Men, the Avengers, Iron Man, the Hulk, Thor, Daredevil, Doctor Strange, and many other characters, introducing complex, naturalistic characters and a thoroughly shared universe into superhero comic books. In addition, he headed the first major successful challenge to the industry's censorship organization, the Comics Code Authority, and forced it to reform its policies. Lee subsequently led the expansion of Marvel Comics from a small division of a publishing house to a large multimedia corporation.\n\nHe was inducted into the comic book industry's Will Eisner Comic Book Hall of Fame in 1994 and the Jack Kirby Hall of Fame in 1995.	USA	/kKeyWoFtTqOPsbmwylNHmuB3En9.jpg
