131133	nm3696388	Trevor Noah	2	1984-02-20 00:00:00	\N	​Trevor Noah is a South African actor, presenter, comedian and radio DJ who began his career with a cameo role on the SABC3 soapie Isidingo, in 2002.  After his stint on the show he spent two years years hosting an educational show for SABC2 during which time he started hosting his own radio show on Yfm called Noah's Ark.  At Yfm his show was called Trevor Noah and was on between 00h00 and 03h00. He is also very involved in the South African comedy circuit and has performed at various comedy festivals.  On television he hosted the SABC1 celebrity gossip show The Real Goboza in 2007 and also hosted SABC's sports show Siyadlala.  In 2008 he was the runner-up on SABC2's reality dance competition Strictly Come Dancing 4, losing to actor Emmanuel Castis in the grand finale. His professional dance partner was Hayley Hammond.  From May to August 2008 he was the co-host (with Pabi Moloi) of the SABC1 interactive dating game show The Amazing Date.  He hosted the 3rd annual SAFTA Awards at the State Theatre in Pretoria on Saturday 7 February, 2009.  Trevor was the host (along with Eugene Khoza) of the e.tv reality competition series The AXE Sweet Life from March to May, 2009.  He hosted the 15th annual South African Music Awards (SAMAs) at the Sun City Superbowl on 2 May, 2009. He was invited back to host the SAMAs in 2010.  Trevor began hosting his own talk show on M-Net in August 2010, entitled Tonight with Trevor Noah, based on international shows such as The Tonight Show with Jay Leno, The Late Show with Conan O'Brien and satirical fare like The Daily Show with Jon Stewart.  The show moved to DStv's Mzansi Magic channel for it second season, which premiered on 5 November, 2010	ZAF	/xwJ3MUh5wJ39KQZ3Lz8v8jzMTng.jpg
