85718	nm1395602	Allen Leech	2	1981-05-18 00:00:00	\N	Allen Leech (born 18 May 1981) is an Irish actor best known for his role as Tom Branson on the historical drama series Downton Abbey (2010–2015). He made his professional acting debut with a small part in a 1998 production of A Streetcar Named Desire, made his first major film appearance as Vincent Cusack in Cowboys & Angels, and earned an Irish Film & Television Awards nomination in 2004 with his performance as Mo Chara in Man About Dog.\n\nHe appeared as Willi in the Queen and Peacock (2000), at the Garter Lane Arts Centre. The following years, he was in The Morning After Optimism (2001) and then Da (2002). His breakthrough film performance was in Cowboys and Angels (2003), followed by a role in the 2004 cross-country caper film Man About Dog. He played the role of Shane Kirwan in Ireland's RTÉ series Love Is the Drug (2004), for which he received a Best Actor nomination from the Irish Film and Television Awards. He followed that up with the role of Willy in the television series Legend (2006), for which he received a Best Supporting Actor nomination from Irish Film and Television Awards.\n\nIn 2010, he appeared on the small screen in The Tudors (2010) as the doomed Francis Dereham. Leech also appeared in ITV 2010s television series Downton Abbey as chauffeur Tom Branson. He played the role of officer Sam Leonard in television series Primeval in 2011 in series five. He also starred in the 2012 film adaptation The Sweeney. In 2014 he starred as the spy John Cairncross, in The Imitation Game. He played Freddie Mercury's personal manager, Paul Prenter, in the biopic Bohemian Rhapsody (2018), which earned him a nomination for Outstanding Performance by a Cast in a Motion Picture at the 25th Screen Actors Guild Awards.\n\nDescription above is from the Wikipedia article Allen Leech, licensed under CC-BY-SA, full list of contributors on Wikipedia.	IRL	/cJZSyKNUKwdNPEgkt2ocXohtUBH.jpg
