1701986	\N	Clementina Guadarrama	1	\N	\N	Hailing from Iguala, Guerrero, and being the eldest of five brothers and sisters, Clementina decided to defy her family and those around her, as she had fallen in love with theater. The culprit: the Mexican actor Esvón Gamaliel.\n\nDuring her adolescence she worked as a maid, just like her mother, and after seeing in Acapulco the play "Una tal Raymunda" by the Mexican master, Clementina decided that someday she would work with that man who stood on stage in a white suit.  At the age of 22, and with a child in her arms, she moved to the city of Toluca to study drama at the Universidad Autónoma del Estado de México. Although this was the place that made her fall in love with theater and taught her to face her shyness, it was also the place where she experienced the first blows of the acting world. She was often discriminated against for being poor and having indigenous features.\n\nWith more maturity, Clementina began to write and direct her own plays. If society did not open doors for her, she would open them for herself. Which she continues to do to this day.  Clementina was part of several series on Channel 11, such as La Malinche, as well as popular characters such as Selena, Juan Gabriel and Julio Cesar Chavez.\n\nFilming the movie "Cría Puercos" allowed her to develop her first co-starring role. It was then that she received the call for a new project of which everything was kept secret. After three castings and many months later, he was confirmed: he would be part of "Roma", a film by Alfonso Cuarón.	MEX	/cT2pW7QEDpuvW75gOP0SD0EcpjF.jpg
