54693	nm1297015	Emma Stone	1	1988-11-06 00:00:00	\N	Emily Jean "Emma" Stone is an American actress. The recipient of numerous accolades, including an Academy Award and a Golden Globe Award, she was the world's highest-paid actress in 2017.\n\nBorn and raised in Scottsdale, Arizona, Stone began acting as a child, in a theater production of The Wind in the Willows in 2000. As a teenager, she relocated to Los Angeles with her mother and made her television debut in In Search of the New Partridge Family (2004), a reality show that produced only an unsold pilot. After small television roles, she made her film debut in Superbad (2007), and received positive media attention for her role in Zombieland (2009). The 2010 teen comedy Easy A was Stone's first starring role, earning her nominations for the BAFTA Rising Star Award and a Golden Globe Award for Best Actress.\n\nStone gained wider recognition as Gwen Stacy in the 2012 superhero film The Amazing Spider-Man, and its 2014 sequel. She was nominated for the Academy Award for Best Supporting Actress for playing a recovering drug addict in the black comedy Birdman (2014), and her Broadway debut came in a revival of the musical Cabaret (2014–2015). She won the Academy Award for Best Actress for playing an aspiring actress in the romantic musical La La Land (2016). Stone received a third Academy Award nomination for her portrayal of Abigail Masham in the historical comedy-drama The Favourite (2018).	USA	/3UaYw9KF4fEXRMRWhf25aGJpAW2.jpg
3293	nm0001838	Rachel Weisz	1	1970-03-07 00:00:00	\N	Rachel Hannah Weisz (born 7 March 1970) is an English actress. She is the recipient of various accolades, including an Academy Award, a Golden Globe Award, a Screen Actors Guild Award, a Laurence Olivier Award, a Critics' Choice Award and a BAFTA Award.\n\nWeisz began acting in British stage and television in the early 1990s, and made her film debut in Death Machine (1994). She won a Critics' Circle Theatre Award for her role in the 1994 revival of Noël Coward's play Design for Living and she went on to appear in the 1999 Donmar Warehouse production of Tennessee Williams' drama Suddenly, Last Summer. Her film breakthrough came with her starring role as Evelyn Carnahan in the Hollywood action films The Mummy (1999) and The Mummy Returns (2001). Weisz went on to star in several films of the 2000s, including Enemy at the Gates (2001), About a Boy (2002), Constantine (2005), The Fountain (2006) and The Lovely Bones (2009).\n\nFor her performance as an activist in the 2005 thriller The Constant Gardener, she won the Academy Award for Best Supporting Actress, and for playing Blanche DuBois in a 2009 revival of A Streetcar Named Desire, she won the Laurence Olivier Award for Best Actress. In the 2010s, Weisz continued to star in big-budget films such as the action film The Bourne Legacy (2012) and the fantasy film Oz the Great and Powerful (2013), and garnered critical acclaim for her performances in the independent films The Deep Blue Sea (2011), Denial (2016), and The Favourite (2018). For her portrayal of Sarah Churchill in the latter, she won the BAFTA Award for Best Actress in a Supporting Role and received a second Academy Award nomination. In 2021, Weisz starred as Melina Vostokoff in the Marvel Cinematic Universe film Black Widow.\n\nWeisz was engaged to filmmaker Darren Aronofsky, with whom she has a son, from 2005 to 2010. She married actor Daniel Craig in 2011, with whom she has a daughter, and became a naturalised US citizen the same year.	GBR	/msTqKPA33ryVtcVNgOdeaJGYq16.jpg
3292	nm0396558	Nicholas Hoult	2	1989-12-07 00:00:00	\N	Nicholas Caradoc Hoult (born December 7, 1989) is an English actor. His body of work includes supporting work in big-budget mainstream productions and starring roles in independent projects in both the American and the British film industries. He has been nominated for awards such as a British Academy Film Award, a Golden Globe Award, and a Screen Actors Guild Award.\n\nBorn and raised in Wokingham, Berkshire, Hoult was drawn to acting from a young age and appeared in local theatre productions as a child. He made his screen debut at age seven in the 1996 film Intimate Relations, and appeared in several television programmes between 1998 and 2001. Hoult's breakthrough role came when he played Marcus Brewer in the 2002 comedy-drama film About a Boy, for which he was nominated for the Critics' Choice Movie Award for Best Young Performer. He achieved wider recognition and praise for his performance as Tony Stonem in the E4 teen comedy-drama series Skins (2007–2008). His transition to adult roles began with the 2009 drama film A Single Man, for which he earned a BAFTA Rising Star Award nomination, and the fantasy film Clash of the Titans (2010). He was cast as the mutant Hank McCoy in Matthew Vaughn's 2011 superhero film X-Men: First Class, a role he reprised in later instalments of the series.\n\nIn 2013, Hoult played the lead title role in the fantasy adaptation Jack the Giant Slayer and starred as a zombie in romantic comedy Warm Bodies. Following a supporting role in Mad Max: Fury Road (2015), Hoult starred in a number of independent films before portraying various real-life figures such as Robert Harley, Earl of Oxford in the historical black comedy The Favourite (2018), writer J. R. R. Tolkien in Tolkien (2019), and Peter III in the Hulu comedy-drama series The Great (2020–present). In 2021, he starred in the survival thriller Those Who Wish Me Dead.	GBR	/laeAYQVBV9U3DkJ1B4Cn1XhpT8P.jpg
1496392	nm7153679	Joe Alwyn	2	1991-02-21 00:00:00	\N	Joseph Matthew Alwyn (born 21 February 1991) is an English actor. He made his feature film debut as the titular character in Ang Lee's 2016 war drama, Billy Lynn's Long Halftime Walk, and has since played supporting roles in films such as The Favourite (2018), Boy Erased (2018), Mary Queen of Scots (2018), and Harriet (2019). His accolades include a Trophée Chopard, a Critics' Choice Movie Award, a Satellite Award, and a Grammy Award.\n\nBorn in Tunbridge Wells, Kent, England, and raised in North London, Alwyn developed an interest in acting during his teenage years and joined the National Youth Theatre in 2009. He acted in two student productions at Edinburgh Festival Fringe, and graduated with a BA degree in English literature and drama from the University of Bristol (2012). He received another BA in acting from the Royal Central School of Speech and Drama (2015). He won the Trophée Chopard at the 2018 Cannes Film Festival, following his appearance in various critically acclaimed films.\n\nAlwyn has also worked with American singer-songwriter Taylor Swift on ten of her songs; he co-wrote tracks such as "Exile", "Betty", "Champagne Problems" and "Coney Island" from Swift's 2020 albums, Folklore and Evermore. "Exile" charted inside the top 10 in eight countries. For his contributions to Folklore, Alwyn won the Album of the Year at the 63rd Annual Grammy Awards. In 2022, he appeared in a lead role of Hulu series Conversations with Friends, starred in the romantic thriller film Stars at Noon, which won the Grand Prix at the 2022 Cannes Film Festival, and featured on the Time 100 Next list.	GBR	/oS6lhMhLT3idc3gdq9Mfyv3baOD.jpg
