9273	nm0010736	Amy Adams	1	1974-08-20 00:00:00	\N	Amy Lou Adams (born August 20, 1974) is an American actress. Known for both her comedic and dramatic roles, she has been featured three times in annual rankings of the world's highest-paid actresses. She has received various accolades, including two Golden Globe Awards, in addition to nominations for six Academy Awards, seven British Academy Film Awards, and two Primetime Emmy Awards.\n\nAdams began her career as a dancer in dinner theater, which she pursued from 1994 to 1998, and made her film debut with a supporting part in the dark comedy Drop Dead Gorgeous (1999). She made guest appearances in television and took on "mean girl" parts in low-budget feature films. Her first major role came in Steven Spielberg's biopic Catch Me If You Can (2002), but she was unemployed for a year afterward. Her breakthrough came when she portrayed a loquacious pregnant woman in the independent comedy-drama Junebug (2005), for which she received her first Academy Award nomination.\n\nThe musical fantasy film Enchanted (2007), in which Adams played a cheerful princess-to-be, was her first success as a leading lady. She followed this by playing other naïve, optimistic women in films like the drama Doubt (2008), and subsequently played more assertive parts to positive reviews in the sports film The Fighter (2010) and the psychological drama The Master (2012). From 2013 to 2017, she portrayed Lois Lane in superhero films set in the DC Extended Universe. She won two consecutive Golden Globe Awards for Best Actress for playing a seductive con artist in the crime film American Hustle (2013) and the painter Margaret Keane in the biopic Big Eyes (2014). Further acclaim came for playing a linguist in the science fiction film Arrival (2016), a self-harming reporter in the HBO miniseries Sharp Objects (2018), and Lynne Cheney in the satire Vice (2018).\n\nAdams' stage roles include the Public Theater's revival of Into the Woods in 2012 and the West End theatre revival of The Glass Menagerie in 2022. In 2014, she was named one of the 100 most influential people in the world by Time, and featured in the Forbes Celebrity 100 list.	ITA	/1h2r2VTpoFb5QefAaBYYQgQzL9z.jpg
4495	nm0136797	Steve Carell	2	1962-08-16 00:00:00	\N	Steven John Carell (born August 16, 1962) is an American actor and comedian. He played Michael Scott in The Office (2005–2011; 2013), NBC’s adaptation of the British series created by Stephen Merchant and Ricky Gervais, where Carell also worked as an occasional producer, writer and director. Carell has received numerous accolades for his performances in both film and television, including the Golden Globe Award for Best Actor – Television Series Musical or Comedy for his work on The Office. He was recognized as "America's Funniest Man" by Life magazine.\n\nCarell gained recognition as a correspondent on The Daily Show with Jon Stewart from 1999 to 2005. He went on to star in several comedy films, including Anchorman: The Legend of Ron Burgundy (2004) and its 2013 sequel, as well as The 40-Year-Old Virgin (2005), Evan Almighty (2007), Get Smart (2008), Date Night (2010), Crazy, Stupid, Love (2011), and The Way, Way Back (2013). He also voice acted in Over the Hedge (2006), Horton Hears a Who! (2008) and the Despicable Me franchise (2010–present).\n\nCarell began to shift into more dramatic roles in the 2010s, with his role as wrestling coach and convicted murderer John Eleuthère du Pont in the drama film Foxcatcher (2014) earning him, among various honors, nominations for the Academy Award for Best Actor, the Golden Globe Award for Best Actor – Motion Picture Drama and the BAFTA Award for Best Actor in a Supporting Role. He also starred in Little Miss Sunshine (2006), The Big Short (2015), and Battle of the Sexes (2017), the last two earning him his eighth and ninth Golden Globe Award nominations, respectively. In 2018, he re-teamed with Anchorman and The Big Short director Adam McKay for the Dick Cheney biographical film Vice, in which he portrayed Donald Rumsfeld, and played journalist David Sheff in the drama film Beautiful Boy.\n\nCarell returned to television as the co-creator of the TBS comedy series Angie Tr