182213	nm0949852	Marcus Young	2	1972-10-01 00:00:00	\N	Marcus Young is a stuntman, martial artist, actor, and stunt coordinator who performed stunts as burly Starfleet cadet in J.J. Abrams' Star Trek. Young also worked as a fight coordinator on Star Trek Into Darkness.  Young previously performed stunts for two of J.J. Abrams' productions; the television series Alias and the action sequel Mission: Impossible III (2006).  Young, born in Honolulu, Hawaii, started his career as a stunt fighter in the late '90s with appearances in the action films Bloodsport III (1996, with John Rhys-Davies, Sidney Liufau, and Scott McElroy), Sworn to Justice (1997, with Brad Dourif, Walter Koenig, and Max Daniels), L.E.T.H.A.L. Ladies: Return to Savage Beach (1998, with Cristian Letelier), Champions (1998, with Jeff Wolfe), and Better Never Than Late (1999). He performed stunts in the thriller True Vengeance (1997, along with Scott McElroy), the action film Recoil (1998, with Thomas Kopache,Robin Curtis, and stunts by Noby Arden, Bobby Burns, Erik Cord, Rosine "Ace" Hatem, Al Jones, and Spiro Razatos), and the science fiction drama Interceptors (1999, with Brad Dourif and stunts by Lauro Chartrand).  Young served as main stunt double for actor Bruce Locke in the fantasy action series Mortal Kombat: Conquest (1998-1999), which starred Kristanna Loken and stunts by Dana Hee, Christopher Leps, and Boni Yanagisawa. Other television series he worked on include Walker, Texas Ranger, Power Rangers Lightspeed Rescue (2000), V.I.P. (2000, with Michael Bailey Smith and stunts by Joni Avery and Darlene Ava Williams), Angel, The Invisible Man (2000, with Jeremy Roberts, Mike Massa, and Denney Pierce), The District, 24, She Spies, Birds of Prey (2002, starring Dina Meyer and Ian Abercrombie), and Threat Matrix.  Further stunt performancs include the thriller The Ghost (2001, with Cary-Hiroyuki Tagawa), the 2001 ABC World Stunt Awards (2001), the comedy sequel Scary Movie 2 (2001, with stunts by Geneviere Anderson,LaFaye Baker, Mike Gunther, and Chris Palermo), John Carpenter's horror film Ghosts of Mars (2001), Sam Raimi's superhero movies Spider-Man (2002) and its sequel Spider-Man 2 (2004), John Woo's war drama Windtalkers (2002), the superhero movie Daredevil (2003), the science fiction sequel The Matrix Reloaded(2003), the horror film Underworld (2003, with Kevin Grevioux and Scott McElroy), and the drama The Last Samurai (2003, written by John Logan).  Behind the camera, Young served as fight choreographer and stunt coordinator on films such as Rob Bowman's fantasy film Elektra (2005, with stunts by Shauna Duggins), the action sequel xXx: State of the Union(2005), the documentary Magnificent Desolation: Walking on the Moon 3D (2005, with Scott Wilder, Neal McDonough, and stunts by Xuyen Valdivia and Denney Pierce), the action film Adventures of Johnny Tao (2007, with Ilram Choi, Bridgett Riley, and stunts by Mike Gunther and Dennis Keiffer), and sevral episodes of the television series Fallen (2007).	USA	/txBvkZc6W5uTDbFeiMJ9sOPyUof.jpg
