12133	nm0582418	Laurie Metcalf	1	1955-06-16 00:00:00	\N	Laura Elizabeth Metcalf (born June 16, 1955) is an American actress and comedian. Often described as a character actor, she is known for her complex and versatile roles across the stage and screen. She has received various accolades throughout her career spanning over four decades, including two Tony Awards and four Primetime Emmy Awards, in addition to nominations for an Academy Award, a BAFTA Award, and three Golden Globe Awards.\n\nMetcalf began her career with the Steppenwolf Theatre Company and frequently works in Chicago theatre. She made her Broadway debut in the 1985 play My Thing of Love. She went on to receive six Tony Award nominations, winning Best Actress in a Play in 2017 for her performance in A Doll's House, Part 2 and Best Featured Actress in a Play for the 2018 revival of Edward Albee's Three Tall Women. Her other Tony-nominated roles were for November (2008), The Other Place (2010), Misery (2016), and Hillary and Clinton (2019).\n\nShe gained national attention for her performance as Jackie Harris on the sitcom Roseanne (1988–1997, 2018) and its spinoff The Conners (2018–present), for which she won three Primetime Emmy Awards for Outstanding Supporting Actress in a Comedy Series. She also won a Primetime Emmy Award for her guest role in Hacks (2022), and her other Emmy-nominated roles include 3rd Rock from the Sun (1999), Monk (2006), Desperate Housewives (2007), The Big Bang Theory (2016), Getting On (2013–2015), and Horace and Pete (2016). She also appeared on The Norm Show (1999–2001), Frasier, and The Dropout (2022).\n\nIn film, Metcalf is best known for her performance as Marion McPherson in Greta Gerwig's comedy-drama film Lady Bird (2017). She was nominated for an Academy Award, a Golden Globe Award, a SAG Award, and a BAFTA Award. From 1995, she has voiced Mrs. Davis, the mother of Andy, in the Toy Story franchise, and voiced Sarah Hawkins in the Disney animated Treasure Planet (2002). Other notable film credits include Desperately Seeking Susan (1985), Uncle Buck (1989), JFK (1991), Dear God (1996), Georgia Rule (2007) and Scream 2 (1997).	USA	/ypAppMZ1Q99cBjtX4BAnZmWjVXe.jpg
1105079	nm2348627	Lucas Hedges	2	1996-12-12 00:00:00	\N	Lucas Hedges (born December 12, 1996) is an American actor. A son of filmmaker Peter Hedges, he studied theater at the University of North Carolina School of the Arts. Hedges began his acting career with a supporting role in Wes Anderson's comedy-drama Moonrise Kingdom (2012). He had his breakthrough in 2016 playing a sardonic teenager in Kenneth Lonergan's drama Manchester by the Sea, which earned him a nomination for the Academy Award for Best Supporting Actor. Hedges then starred as an aggressive youth in an off-Broadway production of Yen and had supporting roles in the coming-of-age film Lady Bird and the drama Three Billboards Outside Ebbing, Missouri in 2017.\n\nIn 2018, Hedges played the lead role of a teenager forced into a gay conversion therapy program in Boy Erased, which earned him a nomination for the Golden Globe Award for Best Actor in a Drama. He also made his Broadway debut in a revival of Lonergan's drama The Waverly Gallery in the same year. In 2023, he starred in a West End theatre production of Brokeback Mountain.\n\nDescription above from the Wikipedia article Lucas Hedges, licensed under CC-BY-SA, full list of contributors on Wikipedia.	USA	/8WP1uXUwm6Z1vzrMaIiKj89M6kX.jpg
