11856	nm0000358	Daniel Day-Lewis	2	1957-04-29 00:00:00	\N	Daniel Michael Blake Day-Lewis (born 29 April 1957) is an actor with both British and Irish citizenship. His portrayals of Christy Brown in My Left Foot (1989), Daniel Plainview in There Will Be Blood (2007) and Abraham Lincoln in Lincoln (2012) won Academy and BAFTA Awards for Best Actor, and Screen Actors Guild as well as Golden Globe Awards for There Will Be Blood and Lincoln. His role as Bill "The Butcher" Cutting in Gangs of New York (2002) earned him the BAFTA Award and a Screen Actors Guild Award.\n\nDay-Lewis, who grew up in London, is the son of actress Jill Balcon and the Anglo-Irish Poet Laureate, Cecil Day-Lewis. He is a method actor, known for his constant devotion to and research of his roles. Often, he will remain completely in character for the duration of the shooting schedule of his films, even to the point of adversely affecting his health. He is known as one of the most selective actors in the film industry, having starred in only seven films since 1997, with as many as five years between roles. Throughout his career Day-Lewis has received numerous accolades and remains the only actor to win the Academy Award for Best Actor three times. In 2012, Time magazine named Day-Lewis "The World's Greatest Actor". In 2017, Day-Lewis announced his retirement from acting, with Phantom Thread (2017) being his final film role.	GBR	/3kNA9VcmymoEwT0btQ4bvMYxzcP.jpg
