34490	nm0005299	Sarah Paulson	1	1974-12-17 00:00:00	\N	Sarah Catharine Paulson (born December 17, 1974) is an American actress. She began her acting career in New York City stage productions before starring in the short-lived television series American Gothic (1995–1996) and Jack & Jill (1999–2001). She later appeared in comedy films such as What Women Want (2000) and Down with Love (2003), and drama films such as Path to War (2002) and The Notorious Bettie Page (2005). From 2006 to 2007, she starred as Harriet Hayes in the NBC comedy-drama series Studio 60 on the Sunset Strip, for which she received her first Golden Globe Award nomination. In 2008, she starred as Ellen Dolan in the superhero noir film The Spirit.\n\nPaulson has appeared on Broadway in the plays The Glass Menagerie in 2005 and Collected Stories in 2010. She also starred in a number of independent films and had a leading role in the ABC comedy series Cupid (2009). She later starred in the independent drama film Martha Marcy May Marlene (2011) and received Primetime Emmy Award and Golden Globe Award nominations for her portrayal of Nicolle Wallace in the HBO film Game Change (2012). She was featured as Mary Epps in the 2013 historical drama film 12 Years a Slave, as Abby Gerhard in the 2015 romantic drama film Carol, and as Toni Bradlee in the 2017 political drama film The Post, all of which were nominated for multiple Academy Awards. Her other films include Serenity (2005), New Year's Eve (2011), Mud (2012), Blue Jay (2016), Ocean's 8 (2018), Bird Box (2018), Glass (2019), and Run (2020).\n\nIn 2011, Paulson began starring in the FX anthology series American Horror Story, playing different characters in many of the show's 10 seasons. For her performances in the series, she received five Primetime Emmy Award nominations and won two Critics' Choice Television Awards. In 2016, she portrayed real-life prosecutor Marcia Clark in the first season of the anthology series American Crime Story, subtitled The People v. O. J. Simpson, for which she garnered critical acclaim and numerous accolades, including the Primetime Emmy Award and the Golden Globe Award. In 2020, Paulson appeared in the FX limited series Mrs. America, and began starring as Nurse Mildred Ratched in the Netflix psychological thriller series Ratched. In 2021, she returned to American Crime Story to portray Linda Tripp in the third season of the show, subtitled Impeachment.	USA	/5i370TVM9oBnijPDqklfFfdhAd7.jpg
