ncinnati, Dr. Nathan Bradford on Sleepwalkers, Thomas Veil on Nowhere Man, Jack Gage on Legmen, Pierce Lawton on Knot's Landing, and Dr. Seth Griffin on St. Elsewhere.\n\nHe has voiced Bruce Wayne / Batman in the animated series Young Justice and in several Batman cartoon videos, and voiced Chiron in the animated series Class Titans.	CAN	/rVpyddWneBBYYzYhMRmWoHMg3Hg.jpg
