17647	nm0735442	Michelle Rodriguez	1	1978-07-12 00:00:00	\N	Mayte Michelle Rodríguez (born July 12, 1978), known professionally as Michelle Rodriguez, is an American actress, screenwriter, and DJ. She got her breakout role as a troubled boxer in the independent film Girlfight (2000), which was met with critical acclaim and earned her several awards, including the Independent Spirit Award and Gotham Award for Best Debut Performance. The following year, she starred as Letty Ortiz in the blockbuster film The Fast and the Furious (2001), reprising her role in its sequels Fast & Furious (2009), Fast & Furious 6 (2013), and Furious 7 (2015).\n\nDuring her career, Rodriguez has played tough, independent women in a number of successful action films, such as Blue Crush, S.W.A.T., Battle: Los Angeles, and Avatar. She is also known for her roles as Shé in the action comedy films Machete and Machete Kills, and Rain Ocampo in the science fiction films Resident Evil and Resident Evil: Retribution.\n\nRodriguez also branched into television, playing Ana Lucia Cortez in the second season of the series Lost as part of the main cast, before making numerous guest appearances before the series ended. She has also done voice work in video games such as Call of Duty and Halo, and lent her voice for the 3D animated film Turbo and the television series IGPX.\n\nWith her films grossing over $5 billion collectively, a 2013 Entertainment Weekly article described Rodriguez as "arguably the most iconic actress in the action genre, as well as one of the most visible Latinas in Hollywood".	USA	/qsXG5kqxB4XdjLACVY8GXNW6Jfg.jpg
15853	nm0836071	Wes Studi	2	1947-12-17 00:00:00	\N	Wesley "Wes" Studi (born December 17, 1947) is an American Cherokee actor, who has earned notability for his portrayals of Native Americans in film. He has appeared in well-received Academy Award-winning films, such as Kevin Costner's Dances with Wolves, Michael Mann's The Last of the Mohicans, the award-winning Geronimo: An American Legend and the Academy Award-nominated film The New World (2005). He most recently portrayed General Linus Abner (an analogue to the biblical Abner) in the NBC series Kings, and Eytukan in James Cameron's box office blockbuster Avatar.	\N	/hIi9rjpOR4az0oJfvlx0FnKSJLv.jpg
10964	nm0022306	Laz Alonso	2	1974-03-25 00:00:00	\N	Lazaro Alonso (born March 25, 1974) is an American actor. He is known for playing Tsu'tey in James Cameron's science fiction film Avatar and Fenix Calderon in the film Fast & Furious. Alonso has had roles in other films such as Jarhead, This Christmas, Miracle at St. Anna and Detroit. As of 2019, Alonso is part of the main cast of Amazon Prime Video original series The Boys (based on the comic book series of the same name) playing the character known as Marvin T. "MM (Mother's Milk)" Milk.	USA	/2mqORLFJBOi3moYWIg6M4d9DnUD.jpg
397312	nm0926677	Jason Whyte	2	\N	\N		\N	/lCZ5Z3RJG6BxP05FPf7kCoQGZdI.jpg
42317	nm0493013	Scott Lawrence	2	1963-09-27 00:00:00	\N	Scott was born in Los Angeles and spent a lot of his childhood with his parents on picket lines campaigning for local civil rights. His father was the executive director of the University of Southern California,Community Services Center, and his mother worked for Operation Breadbasket and other organizations dedicated to improving economic conditions of black communities. After studying electrical engineering for two years at USC, he sat in on a friends acting class, was immediately bitten by the bug and auditioned for USC's Bachelor of Fine Arts acting conservatory the next semester. He started over as a freshman and completed the program in 1986. In 1987, Scott earned his SAG card on the feature film "Punchline". After several equity waiver plays and TV guest stars, Scott landed his first TV series regular role as Whoopi Goldberg's son on the short lived "Bagdad Cafe". The show ended in 1990 and after a few more years in Hollywood, Scott decided to pack up and move to New York to pursue his first love, the theatre. In NYC he worked in off and off-off Broadway shows and was invited into the elite Drama Department Theatre Company for which he performed Tennesee Williams' three character play, "Kingdom of Earth" with Cynthia Nixon and Peter Sarsgaard, directed by John Cameron Mitchell. Scott's proudest theater moment came when he was cast by Lloyd Richards to play Walter Lee in Lorraine Hansberry's, "A Raisin in the Sun". Lloyd fell sick but the production went on to rave reviews at Fords Theater in Washington DC, directed by Seret Scott in 1995. Scott stayed in New york for a few more years working in TV, film and theatre before returning to Los Angeles in 1998. In 1999, he was cast in a guest starring role on the pilot for the CBS drama, "First Monday". Producer/creator/ director, Don Bellasario admired his work enough to create the role of 'Cmdr. Sturgis Turner' for Scott on his long running, hit series "JAG". Scott played the role from 2000 to 2004, when the show was canceled. He continues to live and work in Hollywood, recent notable credits include "The Social Network" and James Cameron's "Avatar". Upcoming credits Include J.J. Abrams next "Star Trek" feature and "The Host", directed by Andrew Niccol. Both due for release in 2013. Scott is the very proud father of two sons, Morgan and Daniel.  - IMDb Mini Biography	USA	/8lwnmlHN6QPK75NwfufsIFZZhmB.jpg
